import React from 'react';
import styled from 'styled-components';

const HeroWrapper = styled.div ` 
backgroundColor: gray; 
`;



const  Footer =  () => (


    <HeroWrapper>
        <row class="col-12"> 
            <p>Soy el Footer, wachi</p>
        </row> 
    </HeroWrapper>

)

export default Footer;
